package ru.gloria_jeans.core.v1.orders.enums;

public enum PackageIdd {

    SMALL_PACKAGE("small", "00055550005550284", 1, ""),
    MEDIUM_PACKAGE("medium", "00055550005550431", 2, ""),
    LARGE_PACKAGE("large", "00055550005550283", 3, "");

    private final String name;
    private final String idd;
    private final Integer lineNo;
    private final String logoPic;

    PackageIdd(String name, String idd, Integer lineNo, String logoPic) {
        this.name = name;
        this.idd = idd;
        this.lineNo = lineNo;
        this.logoPic = logoPic;
    }

    public String getName() {
        return name;
    }

    public String getIdd() {
        return idd;
    }

    public Integer getLineNo() {
        return lineNo;
    }

    public String getLogoPic() {
        return logoPic;
    }
}
